import React from 'react';
import logo from './logo.svg';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
  useParams,
  useRouteMatch
} from 'react-router-dom'
import InstagramEmbed from 'react-instagram-embed';
import './App.css';

const catslist = [
  { id: 0, name: 'Pepper', isProtagonist: false, race: 'Chartreux', color: 'Gris' },
  { id: 1, name: 'Aladdin', isProtagonist: false, race: 'Batard', color: 'Roux TigrÃ©' },
  { id: 2, name: 'Mr Mittens', isProtagonist: true, race: 'Batard', color: 'Noir' },
  { id: 4, name: 'Felix', isProtagonist: false, race: 'Siamois', color: 'Beige et Marron' },
];

const instaPosts = [
  { id: 0, url: 'https://instagr.am/p/Zw9o4/' },
  { id: 1, url: 'https://instagr.am/p/Zw8o4/' },
];

class AjaxComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    fetch("http://jsonplaceholder.typicode.com/todos")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result
          });
          console.log(result)
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      ).catch(console.log)
  }

  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return (
        <div class="column is-three-fifths is-offset-one-quarter catbox">
          <div class="cat">
            <div class="cat__body"></div>
            <div class="cat__body"></div>
            <div class="cat__tail"></div>
            <div class="cat__head"></div>
          </div>
        </div>
      );
    } else {
      return (
        <div>
          {items.map(item => (
            <div className="column is-three-fifths is-offset-one-quarter">
              <div class="box">
                <article class="media">
                  <div class="media-left">
                    <figure class="image is-64x64">
                      <img src="https://bulma.io/images/placeholders/128x128.png" alt="Image" />
                    </figure>
                  </div>
                  <div class="media-content">
                    <div class="content">
                      <p>
                        <strong>{item.title}</strong> <small></small>
                        <br /> Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean efficitur sit amet massa fringilla egestas. Nullam condimentum luctus turpis.
                    </p>
                    </div>
                    <nav class="level is-mobile">
                      <div class="level-left">
                        <a class="level-item" aria-label="reply">
                          <span class="icon is-small">
                            <i class="fas fa-reply" aria-hidden="true"></i>
                          </span>
                        </a>
                        <a class="level-item" aria-label="retweet">
                          <span class="icon is-small">
                            <i class="fas fa-retweet" aria-hidden="true"></i>
                          </span>
                        </a>
                        <a class="level-item" aria-label="like">
                          <span class="icon is-small">
                            <i class="fas fa-heart" aria-hidden="true"></i>
                          </span>
                        </a>
                      </div>
                    </nav>
                  </div>
                </article>
              </div>
            </div>
          ))}
        </div>



      );
    }
  }
}

function RenderInstaPost(props) {
  const content = props.instaposts.map((post) =>
    <div className="column is-one-quarter">
      <InstagramEmbed
        url={post.url}
        maxWidth={320}
        hideCaption={false}
        containerTagName='div'
        protocol=''
        injectScript
        onLoading={() => { }}
        onSuccess={() => { }}
        onAfterRender={() => { }}
        onFailure={() => { }}
      />
    </div>

  );
  return (
    <div className="mediaposts">
      <div className="columns is-multiline is-mobile">
        {content}
      </div>
    </div>
  )
};

const catsTrait = [
  { id: 1, trait: 'gentil', cat: 1 },
  { id: 2, trait: 'maladroit', cat: 2 },
  { id: 3, trait: 'logique', cat: 3 },
  { id: 4, trait: 'revolutionnaire', cat: 4 },
];

function Cats(props) {
  const url = "chat";
  const content = props.catslist.map((cat) =>
    <tr>
      <th>
        <Link to={`${url}/${cat.id}`}>{cat.name}</Link>
      </th>

      <th>
        {cat.isProtagonist ? 'oui' : 'non'}
      </th>
      <th>
        {cat.race}
      </th>
      <th>
        {cat.color}
      </th>
    </tr>

  );
  return (
    <div className="column is-three-fifths is-offset-one-quarter">
      <table className="table is-fullwidth">
        <thead>
          <tr>
            <th>Nom</th>
            <th>Protagoniste ?</th>
            <th>Race</th>
            <th>Couleur</th>
          </tr>
        </thead>
        <tbody>
          {content}
        </tbody>
      </table>
    </div>
  )
};

const characters = [
  { id: 1, name: 'Hello', atck: '1', def: '1', spike: '1' },
  { id: 2, name: 'Helloggzgz', atck: '1', def: '1', spike: '1' },
];

class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = { date: new Date() };
  }
  componentDidMount() {
    this.timerID = setInterval(
      () => this.tick(),
      1000
    );
    document.addEventListener('DOMContentLoaded', () => {

      // Get all "navbar-burger" elements
      const $navbarBurgers = Array.prototype.slice.call(document.querySelectorAll('.navbar-burger'), 0);

      // Check if there are any navbar burgers
      if ($navbarBurgers.length > 0) {

        // Add a click event on each of them
        $navbarBurgers.forEach(el => {
          el.addEventListener('click', () => {

            // Get the target from the "data-target" attribute
            const target = el.dataset.target;
            const $target = document.getElementById(target);

            // Toggle the "is-active" class on both the "navbar-burger" and the "navbar-menu"
            el.classList.toggle('is-active');
            $target.classList.toggle('is-active');

          });
        });
      }

    });
  }

  componentWillUnmount() {
    clearInterval(this.timerID);
  }

  tick() {
    this.setState({
      date: new Date()
    });
  }

  render() {
    return (
      <div>
        <h1>Bonjour, monde !</h1>
        <h2>Il est {this.state.date.toLocaleTimeString()}.</h2>
      </div>
    );
  }
}

